0435\u0432\u043e\u043b\u044e\u0446\u0438\u044e \u0442\u043e\u0432\u0430\u0440\u0438\u0449 \u041b\u0435\u043d\u0438\u043d\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D0%B8%D1%8F\" title=\"\u0411\u0435\u043b\u044c\u0433\u0438\u044f\">\u0411\u0435\u043b\u044c\u0433\u0438\u044f<\/a> \u043d\u0430\u0447\u0430\u043b\u0430 \u0432\u044b\u043f\u043b\u0430\u0447\u0438\u0432\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D0%BD%D1%81%D0%B8%D1%8F\" title=\"\u041f\u0435\u043d\u0441\u0438\u044f\">\u043f\u0435\u043d\u0441\u0438\u0438<\/a> \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D0%BD%D1%81%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D0%B9_%D0%B2%D0%BE%D0%B7%D1%80%D0%B0%D1%81%D1%82\" title=\"\u041f\u0435\u043d\u0441\u0438\u043e\u043d\u043d\u044b\u0439 \u0432\u043e\u0437\u0440\u0430\u0441\u0442\">\u0441\u0442\u0430\u0440\u043e\u0441\u0442\u0438<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 \u0432 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B2%D0%B4%D0%B0_(%D0%B3%D0%B0%D0%B7%D0%B5%D1%82%D0%B0)\" title=\"\u041f\u0440\u0430\u0432\u0434\u0430 (\u0433\u0430\u0437\u0435\u0442\u0430)\">\u041f\u0440\u0430\u0432\u0434\u0435<\/a>\u00bb \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u043e \u0441\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u0435 \u043e \u0432\u044b\u0441\u044b\u043b\u043a\u0435 \u0440\u044f\u0434\u0430 \u0438\u043d\u0442\u0435\u043b\u043b\u0435\u043a\u0442\u0443\u0430\u043b\u043e\u0432 \u0437\u0430 \u0433\u0440\u0430\u043d\u0438\u0446\u0443 (\u0440\u0435\u0439\u0441\u044b \u00abOberb\u00fcrgermeister Haken\u00bb 29\u201430 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u044f \u0438 \u00abPrussia\u00bb 16\u201417 \u043d\u043e\u044f\u0431\u0440\u044f, \u0431.160 \u0447\u0435\u043b\u043e\u0432\u0435\u043a + \u0434\u0440. \u0440\u0435\u0439\u0441\u044b \u0438 \u043f\u043e\u0435\u0437\u0434\u0430). \u0421\u0440\u0435\u0434\u0438 \u0432\u044b\u0441\u043b\u0430\u043d\u043d\u044b\u0445: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%B4%D1%8F%D0%B5%D0%B2,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0435\u0440\u0434\u044f\u0435\u0432, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0411\u0435\u0440\u0434\u044f\u0435\u0432<\/a>, \u0421.&#160;\u041b.&#160;\u0424\u0440\u0430\u043d\u043a, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B2%D0%B0%D0%BD_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87_%D0%98%D0%BB%D1%8C%D0%B8%D0%BD\" class=\"mw-redirect\" title=\"\u0418\u0432\u0430\u043d \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447 \u0418\u043b\u044c\u0438\u043d\">\u0418.&#160;\u0410.&#160;\u0418\u043b\u044c\u0438\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1._%D0%95._%D0%A2%D1%80%D1%83%D0%B1%D0%B5%D1%86%D0%BA%D0%BE%D0%B9\" class=\"mw-redirect\" title=\"\u0421. \u0415. \u0422\u0440\u0443\u0431\u0435\u0446\u043a\u043e\u0439\">\u0421.&#160;\u0415.&#160;\u0422\u0440\u0443\u0431\u0435\u0446\u043a\u043e\u0439<\/a>, \u0411.&#160;\u041f.&#160;\u0412\u044b\u0448\u0435\u0441\u043b\u0430\u0432\u0446\u0435\u0432, \u0410.&#160;\u0410.&#160;\u041a\u0438\u0437\u0435\u0432\u0435\u0442\u0442\u0435\u0440, \u041c.&#160;\u0410.&#160;\u0418\u043b\u044c\u0438\u043d (\u041e\u0441\u043e\u0440\u0433\u0438\u043d), \u041f.&#160;\u0410.&#160;\u0421\u043e\u0440\u043e\u043a\u0438\u043d, \u0424.&#160;\u0410.&#160;\u0421\u0442\u0435\u043f\u0443\u043d, \u0410.&#160;\u0412.&#160;\u0424\u043b\u043e\u0440\u043e\u0432\u0441\u043a\u0438\u0439, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%BB%D0%B3%D0%B0%D0%BA%D0%BE%D0%B2,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0443\u043b\u0433\u0430\u043a\u043e\u0432, \u0421\u0435\u0440\u0433\u0435\u0439 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u0421\u0435\u0440\u0433\u0435\u0439 \u0411\u0443\u043b\u0433\u0430\u043a\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1925_%D0%B3%D0%BE%D0%B4\" title=\"1925 \u0433\u043e\u0434\">1925<\/a>&#160;\u2014 \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u0435 \u0434\u0435\u043a\u0440\u0435\u0442\u0430 \u043e \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D0%BE%D0%B1%D1%89%D0%B5%D0%B5_%D0%BD%D0%B0%D1%87%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D0%BE%D0%B1%D1%80%D0%B0%D0%B7%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u0412\u0441\u0435\u043e\u0431\u0449\u0435\u0435 \u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e\u0435 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u0435\">\u0432\u0441\u0435\u043e\u0431\u0449\u0435\u0433\u043e \u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a>&#160;\u2014 \u0432 \u041f\u0430\u0433\u043c\u0430\u043d\u0435, \u043b\u0435\u0442\u043d\u0435\u0439 \u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BC%D0%B8%D1%80\" title=\"\u042d\u043c\u0438\u0440\">\u044d\u043c\u0438\u0440\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D0%B3%D0%B0%D0%BD%D0%B8%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\">\u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D0%B0%D0%BD%D1%83%D0%BB%D0%BB%D0%B0-%D1%85%D0%B0%D0%BD\" title=\"\u0410\u043c\u0430\u043d\u0443\u043b\u043b\u0430-\u0445\u0430\u043d\">\u0410\u043c\u0430\u043d\u0443\u043b\u043b\u044b-\u0445\u0430\u043d\u0430<\/a>, \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0438 \u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\u043e\u043c \u00ab\u043e \u043d\u0435\u0439\u0442\u0440\u0430\u043b\u0438\u0442\u0435\u0442\u0435 \u0438 \u0432\u0437\u0430\u0438\u043c\u043d\u043e\u043c \u043d\u0435\u043d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u0438\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928_%D0%B3%D0%BE%D0%B4_%D0%B2_%D1%82%D0%B5%D0%B0%D1%82%D1%80%D0%B5\" title=\"1928 \u0433\u043e\u0434 \u0432 \u0442\u0435\u0430\u0442\u0440\u0435\">1928<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d\u0435<\/a> \u043f\u0440\u043e\u0448\u043b\u0430 \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8E%D0%B7%D0%B8%D0%BA%D0%BB\" title=\"\u041c\u044e\u0437\u0438\u043a\u043b\">\u043c\u044e\u0437\u0438\u043a\u043b\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D1%91%D1%85%D0%B3%D1%80%D0%BE%D1%88%D0%BE%D0%B2%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0\" title=\"\u0422\u0440\u0451\u0445\u0433\u0440\u043e\u0448\u043e\u0432\u0430\u044f \u043e\u043f\u0435\u0440\u0430\">\u0422\u0440\u0451\u0445\u0433\u0440\u043e\u0448\u043e\u0432\u0430\u044f \u043e\u043f\u0435\u0440\u0430<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935_%D0%B3%D0%BE%D0%B4\" title=\"1935 \u0433\u043e\u0434\">1935<\/a>&#160;\u2014 \u0440\u0435\u043a\u043e\u0440\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D1%85%D0%B0%D0%BD%D0%BE%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B9_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0442\u0430\u0445\u0430\u043d\u043e\u0432, \u0410\u043b\u0435\u043a\u0441\u0435\u0439 \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\">\u0421\u0442\u0430\u0445\u0430\u043d\u043e\u0432\u0430<\/a>&#160;\u2014 \u0437\u0430 \u0441\u043c\u0435\u043d\u0443 (5 \u0447\u0430\u0441\u043e\u0432 45 \u043c\u0438\u043d\u0443\u0442) \u043e\u043d \u0434\u043e\u0431\u044b\u043b 102 \u0442\u043e\u043d\u043d\u044b \u0443\u0433\u043b\u044f, \u043f\u0440\u0435\u0432\u044b\u0441\u0438\u0432 \u043d\u043e\u0440\u043c\u0443 \u0432 14 \u0440\u0430\u0437.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a><ul><li>\u0417\u0430\u0432\u0435\u0440\u0448\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B8_%D0%BD%D0%B0_%D0%A5%D0%B0%D0%BB%D1%85%D0%B8%D0%BD-%D0%93%D0%BE%D0%BB%D0%B5\" title=\"\u0411\u043e\u0438 \u043d\u0430 \u0425\u0430\u043b\u0445\u0438\u043d-\u0413\u043e\u043b\u0435\">\u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e-\u044f\u043f\u043e\u043d\u0441\u043a\u0438\u0439 \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u044b\u0439 \u043a\u043e\u043d\u0444\u043b\u0438\u043a\u0442<\/a> \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 \u0440\u0435\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D0%BB%D1%85%D0%B8%D0%BD-%D0%93%D0%BE%D0%BB\" title=\"\u0425\u0430\u043b\u0445\u0438\u043d-\u0413\u043e\u043b\">\u0425\u0430\u043b\u0445\u0438\u043d-\u0413\u043e\u043b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BB%D0%B5%D0%B9%D0%B2%D0%B8%D1%86%D0%BA%D0%B8%D0%B9_%D0%B8%D0%BD%D1%86%D0%B8%D0%B4%D0%B5%D0%BD%D1%82\" class=\"mw-redirect\" title=\"\u0413\u043b\u0435\u0439\u0432\u0438\u0446\u043a\u0438\u0439 \u0438\u043d\u0446\u0438\u0434\u0435\u043d\u0442\">\u0418\u043d\u0441\u0446\u0435\u043d\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u0435 \u043d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u0435 \u043d\u0430 \u043d\u0435\u043c\u0435\u0446\u043a\u0443\u044e \u0440\u0430\u0434\u0438\u043e\u0441\u0442\u0430\u043d\u0446\u0438\u044e<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BB%D0%B5%D0%B9%D0%B2%D0%B8%D1%86\" class=\"mw-redirect\" title=\"\u0413\u043b\u0435\u0439\u0432\u0438\u0446\">\u0413\u043b\u0435\u0439\u0432\u0438\u0446\u0435<\/a>, \u043f\u043e\u0441\u043b\u0443\u0436\u0438\u0432\u0448\u0435\u0435 \u043f\u0440\u0435\u0434\u043b\u043e\u0433\u043e\u043c \u0434\u043b\u044f \u043d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D0%BC%D0%B0%D1%85%D1%82\" title=\"\u0412\u0435\u0440\u043c\u0430\u0445\u0442\">\u0432\u0435\u0440\u043c\u0430\u0445\u0442\u0430<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0448\u0430\">\u041f\u043e\u043b\u044c\u0448\u0443<\/a>, \u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0435\u043c \u0447\u0435\u0433\u043e \u0441\u0442\u0430\u043b\u043e \u043d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0442\u043e\u0440\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D0%9E%D1%82%D0%B5%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: \u0412\u043e\u0439\u0441\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/2-%D0%B9_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D1%80%D0%BE%D0%BD%D1%82\" title=\"2-\u0439 \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0439 \u0444\u0440\u043e\u043d\u0442\">2-\u0433\u043e \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0444\u0440\u043e\u043d\u0442\u0430<\/a> \u0432\u043e\u0448\u043b\u0438 \u0432 \u0441\u0442\u043e\u043b\u0438\u0446\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%BC%D1%8B%D0%BD%D0%B8%D1%8F\" title=\"\u0420\u0443\u043c\u044b\u043d\u0438\u044f\">\u0420\u0443\u043c\u044b\u043d\u0438\u0438<\/a>, \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%85%D0%B0%D1%80%D0%B5%D1%81%D1%82\" title=\"\u0411\u0443\u0445\u0430\u0440\u0435\u0441\u0442\">\u0411\u0443\u0445\u0430\u0440\u0435\u0441\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1947_%D0%B3%D0%BE%D0%B4\" title=\"1947 \u0433\u043e\u0434\">1947<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u0441\u0435\u043b\u044c\u0441\u043a\u043e\u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u0421\u0425\u0410&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%BE%D1%82%D0%BE%D1%82%D0%B8%D0%BF%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u041f\u0440\u043e\u0442\u043e\u0442\u0438\u043f\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435\">\u043f\u0440\u043e\u0442\u043e\u0442\u0438\u043f\u0430<\/a> \u043c\u043d\u043e\u0433\u043e\u0446\u0435\u043b\u0435\u0432\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0421\u0430\u043c\u043e\u043b\u0451\u0442\">\u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD-2\" title=\"\u0410\u043d-2\">\u0410\u043d-2<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1951_%D0%B3%D0%BE%D0%B4\" title=\"1951 \u0433\u043e\u0434\">1951<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%8E%D1%81%D1%81%D0%B5%D0%BB%D1%8C%D0%B4%D0%BE%D1%80%D1%84\" title=\"\u0414\u044e\u0441\u0441\u0435\u043b\u044c\u0434\u043e\u0440\u0444\">\u0414\u044e\u0441\u0441\u0435\u043b\u044c\u0434\u043e\u0440\u0444\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%A0%D0%93\" class=\"mw-redirect\" title=\"\u0424\u0420\u0413\">\u0417\u0430\u043f\u0430\u0434\u043d\u0430\u044f \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f<\/a>, \u043f\u043e\u0441\u0442\u0443\u043f\u0438\u043b\u0430 \u0432 \u043f\u0440\u043e\u0434\u0430\u0436\u0443 \u043f\u0435\u0440\u0432\u0430\u044f \u0434\u043e\u043b\u0433\u043e\u0438\u0433\u0440\u0430\u044e\u0449\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%BC%D0%BF%D0%BB%D0%B0%D1%81%D1%82%D0%B8%D0%BD%D0%BA%D0%B0\" title=\"\u0413\u0440\u0430\u043c\u043f\u043b\u0430\u0441\u0442\u0438\u043d\u043a\u0430\">\u0433\u0440\u0430\u043c\u043f\u043b\u0430\u0441\u0442\u0438\u043d\u043a\u0430<\/a> \u0441\u043e \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c\u044e \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f 33 1\/3 \u043e\u0431\u043e\u0440\u043e\u0442\u0430 \u0432 \u043c\u0438\u043d\u0443\u0442\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1952_%D0%B3%D0%BE%D0%B4\" title=\"1952 \u0433\u043e\u0434\">1952<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B5%D0%BB%D1%8C%D1%81%D0%B8%D0%BD%D0%BA%D0%B8\" title=\"\u0425\u0435\u043b\u044c\u0441\u0438\u043d\u043a\u0438\">\u0425\u0435\u043b\u044c\u0441\u0438\u043d\u043a\u0438<\/a> \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0430\u0441\u044c \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0432\u0448\u0430\u044f \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/9_%D0%B0%D0%B2%D0%B3%D1%83%D1%81%D1%82%D0%B0\" title=\"9 \u0430\u0432\u0433\u0443\u0441\u0442\u0430\">9 \u0430\u0432\u0433\u0443\u0441\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D1%85%D0%BC%D0%B0%D1%82%D0%BD%D0%B0%D1%8F_%D0%BE%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B0%D0%B4%D0%B0\" title=\"\u0428\u0430\u0445\u043c\u0430\u0442\u043d\u0430\u044f \u043e\u043b\u0438\u043c\u043f\u0438\u0430\u0434\u0430\">\u0428\u0430\u0445\u043c\u0430\u0442\u043d\u0430\u044f \u043e\u043b\u0438\u043c\u043f\u0438\u0430\u0434\u0430<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u0438\u043d\u044f\u043b\u0430 \u0443\u0447\u0430\u0441\u0442\u0438\u0435 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u0430\u043d\u0434\u0430. \u0414\u0435\u0431\u044e\u0442\u0430\u043d\u0442\u044b \u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0438 \u0443\u0431\u0435\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u0443\u044e \u043f\u043e\u0431\u0435\u0434\u0443. \u041f\u0435\u0440\u0432\u044b\u043c\u0438 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u043c\u0438 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u043c\u0438 \u0441\u0442\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B5%D1%80%D0%B5%D1%81,_%D0%9F%D0%B0%D1%83%D0%BB%D1%8C\" class=\"mw-redirect\" title=\"\u041a\u0435\u0440\u0435\u0441, \u041f\u0430\u0443\u043b\u044c\">\u041f\u0430\u0443\u043b\u044c \u041a\u0435\u0440\u0435\u0441<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BC%D1%8B%D1%81%D0%BB%D0%BE%D0%B2,_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D0%B9_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u043c\u044b\u0441\u043b\u043e\u0432, \u0412\u0430\u0441\u0438\u043b\u0438\u0439 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447\">\u0412\u0430\u0441\u0438\u043b\u0438\u0439 \u0421\u043c\u044b\u0441\u043b\u043e\u0432<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%BE%D0%BD%D1%88%D1%82%D0%B5%D0%B9%D0%BD,_%D0%94%D0%B0%D0%B2%D0%B8%D0%B4_%D0%98%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0440\u043e\u043d\u0448\u0442\u0435\u0439\u043d, \u0414\u0430\u0432\u0438\u0434 \u0418\u043e\u043d\u043e\u0432\u0438\u0447\">\u0414\u0430\u0432\u0438\u0434 \u0411\u0440\u043e\u043d\u0448\u0442\u0435\u0439\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BB%D0%BB%D0%B5%D1%80,_%D0%95%D1%84%D0%B8%D0%BC_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0413\u0435\u043b\u043b\u0435\u0440, \u0415\u0444\u0438\u043c \u041f\u0435\u0442\u0440\u043e\u0432\u0438\u0447\">\u0415\u0444\u0438\u043c \u0413\u0435\u043b\u043b\u0435\u0440<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B5%D1%81%D0%BB%D0%B0%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%98%D1%81%D0%B0%D0%B0%D0%BA_%D0%95%D1%84%D1%80%D0%B5%D0%BC%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u043e\u043b\u0435\u0441\u043b\u0430\u0432\u0441\u043a\u0438\u0439, \u0418\u0441\u0430\u0430\u043a \u0415\u0444\u0440\u0435\u043c\u043e\u0432\u0438\u0447\">\u0418\u0441\u0430\u0430\u043a \u0411\u043e\u043b\u0435\u0441\u043b\u0430\u0432\u0441\u043a\u0438\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%82%D0%BE%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87_(%D1%88%D0%B0%D1%85%D0%BC%D0%B0%D1%82%D0%B8%D1%81%D1%82)\" title=\"\u041a\u043e\u0442\u043e\u0432, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0410\u043b\u0435\u043a