%B5%D0%B9_%D0%AE%D0%B3%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D0%B8\" title=\"\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u0442\u0440\u0438\u0431\u0443\u043d\u0430\u043b \u043f\u043e \u0431\u044b\u0432\u0448\u0435\u0439 \u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u0438\">\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0442\u0440\u0438\u0431\u0443\u043d\u0430\u043b\u0430 \u043f\u043e \u0431\u044b\u0432\u0448\u0435\u0439 \u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u0438<\/a> (\u041c\u0422\u0411\u042e).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2004_%D0%B3%D0%BE%D0%B4\" title=\"2004 \u0433\u043e\u0434\">2004<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u0443 \u0432\u0445\u043e\u0434\u0430 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%B6%D1%81%D0%BA%D0%B0%D1%8F_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)\" title=\"\u0420\u0438\u0436\u0441\u043a\u0430\u044f (\u0441\u0442\u0430\u043d\u0446\u0438\u044f \u043c\u0435\u0442\u0440\u043e)\">\u0441\u0442\u0430\u043d\u0446\u0438\u044e \u043c\u0435\u0442\u0440\u043e \u00ab\u0420\u0438\u0436\u0441\u043a\u0430\u044f\u00bb<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u0451\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%80%D1%80%D0%BE%D1%80%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%BA%D1%82_%D1%83_%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D0%B8_%D0%BC%D0%B5%D1%82%D1%80%D0%BE_%C2%AB%D0%A0%D0%B8%D0%B6%D1%81%D0%BA%D0%B0%D1%8F%C2%BB\" class=\"mw-redirect\" title=\"\u0422\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0430\u043a\u0442 \u0443 \u0441\u0442\u0430\u043d\u0446\u0438\u0438 \u043c\u0435\u0442\u0440\u043e \u00ab\u0420\u0438\u0436\u0441\u043a\u0430\u044f\u00bb\">\u0442\u0435\u0440\u0430\u043a\u0442<\/a>, \u043f\u043e\u0433\u0438\u0431\u043b\u043e 10 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2007_%D0%B3%D0%BE%D0%B4\" title=\"2007 \u0433\u043e\u0434\">2007<\/a>&#160;\u2014 \u0431\u043b\u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BD%D0%BA%D1%83%D0%B2%D0%B5%D1%80\" title=\"\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440\">\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440\u0430<\/a> \u0437\u0430\u0433\u043e\u0440\u0435\u043b\u0441\u044f \u0438 \u0440\u0443\u0445\u043d\u0443\u043b \u043d\u0430 \u0437\u0435\u043c\u043b\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B3%D0%BE%D0%BB%D1%8C%D1%84%D1%8C%D0%B5%D1%80\" title=\"\u041c\u043e\u043d\u0433\u043e\u043b\u044c\u0444\u044c\u0435\u0440\">\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u0448\u0430\u0440<\/a>. \u0418\u0437 13-\u0442\u0438 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u043e\u0432 \u043f\u043e\u0433\u0438\u0431\u043b\u0438 \u0434\u0432\u0430 (\u043c\u0430\u0442\u044c \u0438 \u0434\u043e\u0447\u044c) .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2016_%D0%B3%D0%BE%D0%B4\" title=\"2016 \u0433\u043e\u0434\">2016<\/a>&#160;\u2014 \u0440\u0435\u0448\u0435\u043d\u0438\u0435\u043c \u0421\u0435\u043d\u0430\u0442\u0430 \u0411\u0440\u0430\u0437\u0438\u043b\u0438\u0438 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D0%B5%D1%84,_%D0%94%D0%B8%D0%BB%D0%BC%D0%B0\" title=\"\u0420\u0443\u0441\u0435\u0444, \u0414\u0438\u043b\u043c\u0430\">\u0414\u0438\u043b\u043c\u0430 \u0420\u0443\u0441\u0435\u0444<\/a> \u043e\u0442\u0441\u0442\u0440\u0430\u043d\u0435\u043d\u0430 \u043e\u0442 \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u0438 \u0438\u0437-\u0437\u0430 \u043f\u0440\u0438\u0447\u0430\u0441\u0442\u043d\u043e\u0441\u0442\u0438 \u043a \u043a\u043e\u0440\u0440\u0443\u043f\u0446\u0438\u043e\u043d\u043d\u043e\u043c\u0443 \u0441\u043a\u0430\u043d\u0434\u0430\u043b\u0443.<\/li><\/ul><h2>"}